DROP TABLE IF EXISTS `tbl_energy_plan`;
CREATE TABLE `tbl_energy_plan` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `building_id` bigint(20) DEFAULT NULL COMMENT '建筑ID',
  `name` varchar(100) DEFAULT NULL COMMENT '计划名称',
  `description` varchar(300) DEFAULT NULL COMMENT '描述',
  `energy_type` varchar(5) DEFAULT NULL COMMENT '能耗类型(从基础数据表获取能耗类型)',
  `year` int(11) DEFAULT NULL COMMENT '计划年份',
  `plan_type` int(11) DEFAULT NULL COMMENT '计划类型(0：总计划，1：分项，2：区域，3：组织机构，4：自定义类别)',
  `status` int(11) DEFAULT NULL COMMENT '状态(0：启用，1：停用)',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `sum_value` decimal(10,2) DEFAULT NULL COMMENT '总计划能耗',
  `january` decimal(10,2) DEFAULT NULL COMMENT '一月计划能耗',
  `february` decimal(10,2) DEFAULT NULL COMMENT '二月计划能耗',
  `march` decimal(10,2) DEFAULT NULL COMMENT '三月计划能耗',
  `april` decimal(10,2) DEFAULT NULL COMMENT '四月计划能耗',
  `may` decimal(10,2) DEFAULT NULL COMMENT '五月计划能耗',
  `june` decimal(10,2) DEFAULT NULL COMMENT '六月计划能耗',
  `july` decimal(10,2) DEFAULT NULL COMMENT '七月计划能耗',
  `august` decimal(10,2) DEFAULT NULL COMMENT '八月计划能耗',
  `september` decimal(10,2) DEFAULT NULL COMMENT '九月计划能耗',
  `october` decimal(10,2) DEFAULT NULL COMMENT '十月计划能耗',
  `november` decimal(10,2) DEFAULT NULL COMMENT '十一月计划能耗',
  `december` decimal(10,2) DEFAULT NULL COMMENT '十二月计划能耗',
  `parent` bigint(20) DEFAULT NULL COMMENT '所属计划ID',
  `relevance_id` bigint(20) DEFAULT NULL COMMENT '关联的ID(包括分项、区域、组织机构和自定义类别)',
  PRIMARY KEY (`id`),
  KEY `tbl_energy_plan_fk` (`building_id`) USING BTREE,
  KEY `tbl_energy_plan_parent_fk` (`parent`) USING BTREE,
  CONSTRAINT `tbl_energy_plan_fk` FOREIGN KEY (`building_id`) REFERENCES `tbl_building` (`id`) ON DELETE CASCADE,
  CONSTRAINT `tbl_energy_plan_parent_fk` FOREIGN KEY (`parent`) REFERENCES `tbl_energy_plan` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

