-- ----------------------------
-- Procedure structure for create_history_data_table_pro
-- ----------------------------
DROP PROCEDURE IF EXISTS `create_history_data_table_pro`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `create_history_data_table_pro`(IN `createDate` datetime)
BEGIN
	DECLARE nextMonth datetime;
	DECLARE monthStr  varchar(6);
	DECLARE yearStr   varchar(4);
	DECLARE tableCount int;
  
	set nextMonth=DATE_ADD(createDate,INTERVAL 1 MONTH);
	set monthStr=DATE_FORMAT(nextMonth,'%Y%m');
	set yearStr=DATE_FORMAT(nextMonth,'%Y');
	/*tbl_energy_electricity*/
	SELECT count(1) into tableCount FROM information_schema.TABLES WHERE table_name = CONCAT('tbl_energy_electricity_hour_',monthStr);
	if tableCount=0 THEN
		set @csql=CONCAT('CREATE TABLE ','tbl_energy_electricity_hour_',monthStr,'('
							,'id bigint(20) NOT NULL AUTO_INCREMENT,'
							,'item_name varchar(100) DEFAULT NULL,'
							,'date_time datetime DEFAULT NULL,'
							,'value decimal(10,2) DEFAULT NULL,'
							,'real_value decimal(10,2) DEFAULT NULL,'
							,'rate decimal(10,2) DEFAULT NULL,'
							,'error int(11) DEFAULT NULL,'
							,'PRIMARY KEY (id),'
							,'KEY electricity_item_name_index (item_name),'
							,'KEY electricity_date_time_index (date_time)'
							,') ENGINE=InnoDB DEFAULT CHARSET=utf8;');
		PREPARE create_stmt from @csql;  
		EXECUTE create_stmt;
	end if;

	SELECT count(1) into tableCount FROM information_schema.TABLES WHERE table_name = CONCAT('tbl_energy_electricity_day_',yearStr);
	if tableCount=0 THEN
		set @csql=CONCAT('CREATE TABLE ','tbl_energy_electricity_day_',yearStr,'('
							,'id bigint(20) NOT NULL AUTO_INCREMENT,'
							,'item_name varchar(100) DEFAULT NULL,'
							,'date_time datetime DEFAULT NULL,'
							,'value decimal(10,2) DEFAULT NULL,'
							,'real_value decimal(10,2) DEFAULT NULL,'
							,'rate decimal(10,2) DEFAULT NULL,'
							,'error int(11) DEFAULT NULL,'
							,'PRIMARY KEY (id),'
							,'KEY electricity_item_name_index (item_name),'
							,'KEY electricity_date_time_index (date_time)'
							,') ENGINE=InnoDB DEFAULT CHARSET=utf8;');
		PREPARE create_stmt from @csql;  
		EXECUTE create_stmt;
	end if;

	/*tbl_energy_water*/
	SELECT count(1) into tableCount FROM information_schema.TABLES WHERE table_name = CONCAT('tbl_energy_water_hour_',monthStr);
	if tableCount=0 THEN
		set @csql=CONCAT('CREATE TABLE ','tbl_energy_water_hour_',monthStr,'('
							,'id bigint(20) NOT NULL AUTO_INCREMENT,'
							,'item_name varchar(100) DEFAULT NULL,'
							,'date_time datetime DEFAULT NULL,'
							,'value decimal(10,2) DEFAULT NULL,'
							,'real_value decimal(10,2) DEFAULT NULL,'
							,'rate decimal(10,2) DEFAULT NULL,'
							,'error int(11) DEFAULT NULL,'
							,'PRIMARY KEY (id),'
							,'KEY electricity_item_name_index (item_name),'
							,'KEY electricity_date_time_index (date_time)'
							,') ENGINE=InnoDB DEFAULT CHARSET=utf8;');
		PREPARE create_stmt from @csql;  
		EXECUTE create_stmt;
	end if;

	SELECT count(1) into tableCount FROM information_schema.TABLES WHERE table_name = CONCAT('tbl_energy_water_day_',yearStr);
	if tableCount=0 THEN
		set @csql=CONCAT('CREATE TABLE ','tbl_energy_water_day_',yearStr,'('
							,'id bigint(20) NOT NULL AUTO_INCREMENT,'
							,'item_name varchar(100) DEFAULT NULL,'
							,'date_time datetime DEFAULT NULL,'
							,'value decimal(10,2) DEFAULT NULL,'
							,'real_value decimal(10,2) DEFAULT NULL,'
							,'rate decimal(10,2) DEFAULT NULL,'
							,'error int(11) DEFAULT NULL,'
							,'PRIMARY KEY (id),'
							,'KEY electricity_item_name_index (item_name),'
							,'KEY electricity_date_time_index (date_time)'
							,') ENGINE=InnoDB DEFAULT CHARSET=utf8;');
		PREPARE create_stmt from @csql;  
		EXECUTE create_stmt;
	end if;

	/*tbl_energy_gas*/
	SELECT count(1) into tableCount FROM information_schema.TABLES WHERE table_name = CONCAT('tbl_energy_gas_hour_',monthStr);
	if tableCount=0 THEN
		set @csql=CONCAT('CREATE TABLE ','tbl_energy_gas_hour_',monthStr,'('
							,'id bigint(20) NOT NULL AUTO_INCREMENT,'
							,'item_name varchar(100) DEFAULT NULL,'
							,'date_time datetime DEFAULT NULL,'
							,'value decimal(10,2) DEFAULT NULL,'
							,'real_value decimal(10,2) DEFAULT NULL,'
							,'rate decimal(10,2) DEFAULT NULL,'
							,'error int(11) DEFAULT NULL,'
							,'PRIMARY KEY (id),'
