-- ----------------------------
-- Procedure structure for insert_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `insert_data`(IN `createDate` datetime)
BEGIN
	DECLARE nextMonth datetime;
	DECLARE monthStr  varchar(6);
	DECLARE yearStr   varchar(4);
	DECLARE tableCount int;
  
	set nextMonth=DATE_ADD(createDate,INTERVAL 1 MONTH);
	set monthStr=DATE_FORMAT(nextMonth,'%Y%m');
	set yearStr=DATE_FORMAT(nextMonth,'%Y');
	/*tbl_energy_electricity*/
	SELECT nextMonth;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getBuildAreaParentList
-- ----------------------------
DROP FUNCTION IF EXISTS `getBuildAreaParentList`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getBuildAreaParentList`(rootId INT) RETURNS varchar(1000) CHARSET latin1
BEGIN
DECLARE sParentList varchar(1000);
DECLARE sParentTemp varchar(1000);
SET sParentTemp =cast(rootId as CHAR);
WHILE sParentTemp is not null DO
IF (sParentList is not null) THEN
SET sParentList = concat(sParentTemp,',',sParentList);
ELSE
SET sParentList = concat(sParentTemp);
END IF;
SELECT group_concat(parent_id) INTO sParentTemp FROM tbl_building_area where FIND_IN_SET(id,sParentTemp)>0;
END WHILE;
RETURN sParentList;
END
;;
DELIMITER ;

