-- ----------------------------
-- Function structure for getParentList
-- ----------------------------
DROP FUNCTION IF EXISTS `getParentList`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getParentList`(urlMenu varchar(100)) RETURNS varchar(1000) CHARSET latin1
BEGIN     DECLARE sParentList varchar(1000);     DECLARE sParentTemp varchar(1000); SELECT	group_concat(t3.id) INTO sParentTemp FROM	(SELECT	max(id) AS id FROM	tbl_resource t WHERE	t.url = urlMenu) t3;WHILE sParentTemp is not null DO    IF (sParentList is not null) THEN     SET sParentList = concat(sParentTemp,',',sParentList);    ELSE    SET sParentList = concat(sParentTemp);    END IF;     SELECT group_concat(parent) INTO sParentTemp FROM tbl_resource where FIND_IN_SET(id,sParentTemp)>0; END WHILE;    RETURN sParentList;  END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for getResourceParentList
-- ----------------------------
DROP FUNCTION IF EXISTS `getResourceParentList`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `getResourceParentList`(urlMenu VARCHAR(100)) RETURNS varchar(1000) CHARSET latin1
BEGIN
	DECLARE sParentList VARCHAR(1000) ; 
	DECLARE sParentTemp VARCHAR(1000) ; 
	SELECT
				group_concat (t3.id) INTO sParentTemp
			FROM
				(
					SELECT
						MAX (id) AS id
					FROM
						tbl_resource t
					WHERE
						t.url = urlMenu
				) t3 ;
			WHILE sParentTemp IS NOT NULL DO
			IF (sParentList IS NOT NULL) THEN

			SET sParentList = concat (
				sParentTemp,
				',',
				sParentList
			) ;
			ELSE

			SET sParentList = concat (sParentTemp) ;
			END
			IF ; SELECT
				group_concat (parent) INTO sParentTemp
			FROM
				tbl_resource
			WHERE
				FIND_IN_SET (id, sParentTemp) > 0 ;
			END
			WHILE ; RETURN sParentList ;
			END
;;
DELIMITER ;

